import React, { Component } from 'react';
import Logo from "./header/Logo"
import Nav from "./header/Nav"

class Header extends Component {
    state = {}
    render() {
        return (
            <div>
                <header>
                    <Logo />
                    <Nav />
                </header>
            </div>
        );
    }
}

export default Header;
